import React from 'react'
import { useState } from 'react'
function Fetch(){
    const [data,setData] = useState({})

    const familyhandler = () =>{
        fetch(`https://excuser.herokuapp.com/v1/excuse/family/`)
        .then((resp) => resp.json())
        .then((wdata) =>{console.log(wdata)
        setData(wdata)

        })
    }

   const partyhandler = () =>{
    fetch(`https://excuser.herokuapp.com/v1/excuse/party/`)
    .then((resp)=>resp.json())
    .then((wdata)=>{console.log(wdata)
    setData(wdata)

    })
   } 

   const officehandler = () =>{
    fetch(`https://excuser.herokuapp.com/v1/excuse/office/`)
    .then((resp)=> resp.json())
    .then((wdata)=>{console.log(wdata)
    // setData(wdata)
    wdata.map((item)=>{
        setData(item)
    })
    })
   }
    return(
        <div>
           <div> 
            <button onClick={familyhandler}>Family</button>
            <p>{data[0]?.excuse}</p>
           </div>
            <button onClick={partyhandler}>Party</button>
            <p>{data[0]?.excuse}</p>
            <button onClick={officehandler}>Office</button>
            <p>{data[0]?.excuse}</p>
        </div>
    )
}

export default Fetch
